import React, { useState } from 'react';
import fixtureData from './FixtureData';

const Fixture = () => {
  const [fixtures] = useState(fixtureData);

  return (
    <div>
      <h2 style={{ color: "#a18525" }}>Fixtures</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Time</th>
            <th>Home Team</th>
            <th>Away Team</th>
            <th>Venue</th>
          </tr>
        </thead>
        <tbody>
          {fixtures.map((fixture) => (
            <tr key={fixture.id}>
              <td>{fixture.date}</td>
              <td>{fixture.time}</td>
              <td>{fixture.homeTeam}</td>
              <td>{fixture.awayTeam}</td>
              <td>{fixture.venue}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Fixture;
